import React from 'react';
import Particles from 'react-particles-js';

const LandingPage = () => (
  <div className='Landing-header'>

    <Particles
      params={{
        'particles': {
            'number': {
                'value': 100
            },
            'size': {
                'value': 5
            },
            'color': {
              'value': '#003'
            },
            'line_linked': {
              'color': '#003',
              'width': '2'
            }
        },
        'interactivity': {
            'events': {
                'onhover': {
                    'enable': true,
                    'mode': 'grab'
                },
                'onclick': {
                  'enable': true,
                  'mode': 'push'
                }
            }
        }
    }}
    />
  </div>
);


export default LandingPage;
